  const { name, label, value, onChange } = props;

  const convertToDefEventPara = (name, value) => ({
    target: {
      name,
      value,
    },
  });

  return (
    <FormControl>
      <FormControlLabel
        control={
          <MuiCheckbox
            name={name}
            color="primary"
            checked={value}
            // onChange={(e) =>
            //   onChange(convertToDefEventPara(name, e.target.checked))
            // }
          />
        }
        label={label}
      />
    </FormControl>
  );
}
